import '../css/color.css';

function Color() {
  return (
    <div className="Color">
      <div className="latern"></div>
      <div className="colortp"> COLOR </div>
      <div className="color">
        <h6 className="cfont" ><div className="redsquare"></div> <b>สีแดง</b> เป็นสีที่ชาวจีนเชื่อว่าเป็นสีศิริมงคล
        <br></br>ดังจะเห็นได้ว่าในงานมงคลต่างๆ ของคนจีนไม่ว่าจะเป็นงานแต่ง วันตรุษจีน
</h6></div>
      <div className="color"> 
        <h6 className="cfont" ><div className="yellowsquare"></div><b>สีเหลือง</b> กลุ่มแรกคือกษัตรย์ซึ่งเห็นได้จากหนังจีน เครื่องแต่งกาย
      <br></br>และภาชนะต่างๆ เป็นสีเหลืองทอง กลุ่มที่สองคืออาจาร์ยปราบผี</h6></div>
      <div className="color">
        <h6 className="cfont" ><div className="whitesquare"></div><b>สีขาว</b> ตามธรรมเนียมจีนสีขาวคือสีสำหรับการไว้ทุกข์
      <br></br>ถ้าท่านสังเกตในพิธีงานศพของจีนจะเห็นลูกหลานแต่งชุดสีขาวอยู่</h6></div>
    </div>
  );
}

export default Color;
